column3:
Partenor Group est un cabinet de conseil français indépendant spécialisé dans l'innovation technologique et managériale. Son fort ancrage dans des secteurs d’activité définis lui procure une véritable pertinence au niveau des métiers qu’il adresse. Avec 510 consultants et un chiffre d'affaires de 67 millions d'euros en 2018, le groupe s’appuie sur la force d’innovation de 3 entités pour accompagner la transformation des entreprises du secteur privé et du secteur public : 
• Le pôle Stratégie et Management accompagne les clients dans la recherche de nouveaux gisements de progrès, dans l’adaptation de leurs organisations internes aux nouvelles exigences de l’environnement contemporain et met en place la cruciale conduite du changement pour garantir le succès de la transformation ; 
• Le pôle Conseil et Projets Digitaux accompagne les directions techniques et informatiques dans la transition digitale de leur entreprise, leur permettant de faire de leur système d’information un atout stratégique pour le succès de l’entreprise grâce à la modélisation des métiers, l’optimisation des processus, l’urbanisation et le pilotage de projets ; 
• Le Pôle Technologie et Innovation aide ses clients à gagner en agilité et en capacité d’adaptation et de réaction. Il les accompagne également dans la mise en œuvre des solutions digitales choisies. L’équipe est à la pointe de l’innovation avec des profils experts, force de proposition dans les choix technologiques adaptés à vos besoins.
